import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';

const EditEmployee = () => {
    const[employees, setEmployees] = useState({
        pkEmpId: "",
        emailId:"",
        passwd:"",
    });
    const{pkEmpId,emailId,passwd} = employees;

    const navigate = useNavigate();

    const handlesubmit = (e)=>{
      e.preventDefault();
      axios.post('http://localhost:8080/saveemployee',employees);
                    navigate("/retriveEmployee")
                };


  return (
    <div>
    <Form handlesubmit ={(e)=>handlesubmit(e)}>
      <div className="mb-3">
        <div className="d-flex justify-content-between m-3">
        <h2>Edit Employee </h2>
        <Link to = "/RetriveEmployee">
        <Button variant="primary">Show data</Button>
        </Link>
        </div>
        <div>
        <label>pkEmpId</label>
        <input type="number" onChange={(e)=>setpkEmpId(e.target.value)}/>
        </div>
        <div>
        <label>EmailId</label>
        <input type="email" onChange={(e)=>setEmailId(e.target.value)}/>
        </div>
        <div>
        <label>Passwd</label>
        <input type="password" onChange={(e)=>setPasswd(e.target.value)} />
        </div>
        <Button type="submit" onClick={handlesubmit}>submit</Button>
        <Link to = "/RetriveEmployee">
        <Button variant="primary">Cancel</Button> 
        </Link>
      </div>
    </Form>
    </div>
  );
  
}

export default EditEmployee
